import 'package:image/image.dart' as IMG;

class PicShow extends StatefulWidget {
  PicShow({Key? key, required this.base64, this.height, this.width})
      : super(key: key);
  String base64;
  double? height;
  double? width;
  @override
  State createState() => PicShowState();
}

class PicShowState extends State<PicShow> {
  // String _base64 = base64pic01;

  @override
  Widget build(BuildContext context) {
    if (widget.base64 == "") return Container();
    Uint8List bytes = base64.decode(widget.base64);
    return SizedBox(
      height: widget.height ?? 50,
      width: widget.width ?? 50,
      child: Image.memory(bytes),
    );
  }
}

class PicShowAct extends StatefulWidget {
  PicShowAct({Key? key, required this.base64, this.height, this.width})
      : super(key: key);
  String base64;
  double? height;
  double? width;
  @override
  State createState() => PicShowActState();
}

class PicShowActState extends State<PicShowAct> {
  // String _base64 = base64pic01;

  @override
  Widget build(BuildContext context) {
    if (widget.base64 == "") return Container();
    if (widget.base64.contains("data:image/jpeg;base64,")) {
      Uint8List bytes = base64.decode(widget.base64);
      return SizedBox(
        height: widget.height ?? 50,
        width: widget.width ?? 50,
        child: Transform.rotate(
            // angle: 1.57,
            angle: 0,
            child: Image.memory(
              bytes,
            )),
      );
    } else {
      // return SizedBox(
      //   height: widget.height ?? 50,
      //   width: widget.width ?? 50,
      // );
      Uint8List bytes = base64.decode("${widget.base64}");
      return SizedBox(
        height: widget.height ?? 50,
        width: widget.width ?? 50,
        child: Transform.rotate(
            // angle: 1.57,
            angle: 0,
            child: Image.memory(
              bytes,
            )),
      );
    }
  }
}

class IMGbutton extends StatefulWidget {
  IMGbutton({
    Key? key,
    required this.base64pic,
    required this.setimg,
  }) : super(key: key);
  String base64pic;
  Function setimg;
  @override
  State<IMGbutton> createState() => _IMGbuttonState();
}

class _IMGbuttonState extends State<IMGbutton> {
  @override
  Widget build(BuildContext context) {
    return ElevatedButton(
      child: const Text('UPLOAD IMG'),
      onPressed: () async {
        var picked = await FilePicker.platform.pickFiles();
        Uint8List? imageByte;
        Uint8List? resizedData;

        if (picked != null) {
          imageByte = picked.files.first.bytes;
          IMG.Image? img = IMG.decodeImage(imageByte!);
          IMG.Image? img2 = IMG.copyResize(img!, width: 300);
          resizedData = IMG.encodeJpg(img2) as Uint8List?;
          setState(() {
            widget.setimg(base64.encode(resizedData!));
          });
        }
      },
    );
  }
}

